<?php
namespace App;

class Brut {

    public $url = 'http://pornopage.biz';


    public function getCatsUrls()
    {
        $catsUrls = $this->getXPathResult($this->url, '//div[@class="thumbs"]/a/@href');
        /* Traverse the DOMNodeList object to output each DomNode's nodeValue */

        foreach ($catsUrls as $i => $node) {
            $packsUrls = $this->getXPathResult($node->value, '//div/div/a/@href');
            foreach ($packsUrls as $packUrl) {
                $photosUrls = $this->getXPathResult($packUrl->value, '//main/div/a/img/@src');
                foreach ($photosUrls as $photoUrl) {
                    $this->getPhoto($photoUrl->value);
                }
            }
        }
    }

    public function getPhoto($url)
    {
        $arrImg = explode('/', $url);
        $name = array_pop($arrImg);
        $path = 'C:\OpenServer\domains\pf.loc\img/'.(time()+random_int(0,9999999)).$name;
        file_put_contents($path, file_get_contents($url));
        \Image::create(array('path' => $path, 'type' => 0, 'name' => $name));
        var_dump($path.$name);
    }

    public function getXPathResult($url, $filter)
    {
        libxml_use_internal_errors(true);
        /* Createa a new DomDocument object */
        $dom = new \DomDocument;
        /* Load the HTML */
        $dom->loadHTMLFile($url);
        /* Create a new XPath object */
        $xpath = new \DomXPath($dom);
        /* Query all <td> nodes containing specified class name */
        $nodes = $xpath->query($filter);

        return $nodes;
    }

    public function loadImg()
    {

        $res = '{"requests":[{"image":{"content":""},"features":[{"type":"TYPE_UNSPECIFIED","maxResults":50},{"type":"LANDMARK_DETECTION","maxResults":50},{"type":"FACE_DETECTION","maxResults":50},{"type":"LOGO_DETECTION","maxResults":50},{"type":"LABEL_DETECTION","maxResults":50},{"type":"TEXT_DETECTION","maxResults":50},{"type":"DOCUMENT_TEXT_DETECTION","maxResults":50},{"type":"SAFE_SEARCH_DETECTION","maxResults":50},{"type":"IMAGE_PROPERTIES","maxResults":50},{"type":"CROP_HINTS","maxResults":50},{"type":"WEB_DETECTION","maxResults":50}],"imageContext":{"cropHintsParams":{"aspectRatios":[0.8,1,1.2]}}}]}';

        if( $curl = curl_init() ) {
            curl_setopt($curl, CURLOPT_URL, 'https://cxl-services.appspot.com/proxy?url=https%3A%2F%2Fvision.googleapis.com%2Fv1%2Fimages%3Aannotate');
            curl_setopt($curl, CURLOPT_RETURNTRANSFER,true);
            curl_setopt($curl, CURLOPT_POST, true);
            curl_setopt($curl, CURLOPT_POSTFIELDS, "$res");
            $out = curl_exec($curl);
            echo $out;
            curl_close($curl);
        }
    }

}